import React, { Component } from 'react';

class MovieContainer extends Component {

  allMovies = this.props.movies.map(movie => {
    return <MovieInfo
      movieObj={ movie }
      key={ movie.id }
      onClick={ this.props.handleButtonClick }
    />
  })

  render() {
    return (
      <div></div>
    );
  }

}

export default MovieContainer;
